import './App.css';
import {Box} from "@mui/material"
import Hero from './Components/Hero';
import Details from './Components/Details';
import HeroData from './HeroData'

function App() {
  return (
    <Box className="App" sx={{margin: "0 20px"}}>
      <Hero {...HeroData} />
      <Details />
    </Box>
  );
}

export default App;
